export class WebsiteSearch extends Component<{
    name: string;
    numberOfPokemons: number;
}> {
    render() {
        const { name, numberOfPokemons } = this.props;
        return <div>
    <p>User {name} has {numberOfPokemons} of pokemons</p>
        </div>
    }
};

export default WebsiteSearch;
